import { Description, Title } from "modules/photoBooth/components/PBComponents";
import { useState } from "react";

import test_image from "../../../assets/images/test_images/Mesh.png";
import test_loading from "../../../assets/images/test_images/Loading.gif";
import test_qr from "../../../assets/images/test_images/QR.jpeg";

function requestPermission() {
  console.log("권한 요청 중...");
  Notification.requestPermission().then((permission) => {
    if (permission === "granted") {
      console.log("알림 권한이 허용됨");
    } else {
      console.log("알림 권한 허용 안됨");
    }
  });
}

function Viewer() {
  const [waiting_text, setWaitingText] = useState("Waiting");
  const [page, setPage] = useState("WAITING");

  function View() {
    return (
      <div style={{ marginTop: "5%", marginBottom: "5%" }}>
        <img src={test_image} style={{ width: "100%" }} />
      </div>
    );
  }

  function MeshViewer() {
    return (
      <>
        <img src={test_image} style={{ width: "100%", marginTop: "15%" }} />
        <input
          type="button"
          value="Play in CES"
          style={{
            width: "44%",
            height: 70,
            position: "fixed",
            bottom: 0,
            right: "4%",
            borderRadius: 30,
            backgroundColor: "yellowgreen",
            fontSize: 24,
            color: "black",
          }}
        />
        <div style={{ bottom: "20%" }}>
          <Title val="This is awesome!" />
          <Description val="Your original photo was discarded. 3D model will be discarded when this window closes." />
        </div>
        <input
          type="button"
          value="Try another"
          style={{
            width: "80%",
            height: 70,
            position: "fixed",
            bottom: 75,
            margin: "10%",
            borderRadius: 30,
            backgroundColor: "yellowgreen",
            fontSize: 24,
            color: "black",
          }}
          onClick={() => {
            setPage("WAITING");
          }}
        />

        <input
          type="button"
          value="Go to Square"
          style={{
            width: "80%",
            height: 70,
            position: "fixed",
            bottom: 0,
            margin: "10%",
            borderRadius: 30,
            backgroundColor: "yellowgreen",
            fontSize: 24,
            color: "black",
          }}
          onClick={() => {
            alert("3D 공간 상에서 모델을 컨트롤 할 수 있는 페이지 (미구현)");
          }}
        />
      </>
    );
  }

  function Waiting() {
    setTimeout(() => {
      setPage("DONE");
    }, 13000);

    const picture = require("../../../assets/images/test_images/Loading.gif"); // this is sync

    return (
      <>
        <div
          style={{
            display: "flex",
            justifyContent: "center",
            marginTop: "-45%",
          }}
        >
          <img src={picture} style={{ width: "100%", zIndex: "-1" }} />
        </div>
        <input
          type="button"
          value="wait somewhere else?"
          style={{
            width: "80%",
            height: 70,
            position: "fixed",
            bottom: 0,
            margin: "10%",
            borderRadius: 30,
            backgroundColor: "yellowgreen",
            fontSize: 24,
            color: "black",
          }}
          onClick={() => {
            var id = window.setTimeout(function () {}, 0);

            while (id--) {
              window.clearTimeout(id);
            }

            setPage("QR");
          }}
        />
      </>
    );
  }

  function QRRequest() {
    return (
      <>
        <div
          style={{ display: "flex", justifyContent: "center", color: "white" }}
        >
          <img
            src={test_qr}
            style={{ zIndex: "-1", width: 144, marginTop: "10%" }}
          />
        </div>

        <div
          style={{
            color: "white",
            margin: "10%",
            fontSize: 24,
          }}
        >
          The photo was successfully sent to the server. Access the waiting page
          via the QR code and get an notification when it's ready!
        </div>
        <input
          type="button"
          value="Hmm.. I'll wait here"
          style={{
            width: "80%",
            height: 70,
            position: "fixed",
            bottom: 75,
            margin: "10%",
            borderRadius: 30,
            backgroundColor: "yellowgreen",
            fontSize: 24,
            color: "black",
          }}
          onClick={() => {
            setPage("WAITING");
          }}
        />

        <input
          type="button"
          value="Okay, bye!"
          style={{
            width: "80%",
            height: 70,
            position: "fixed",
            bottom: 0,
            margin: "10%",
            borderRadius: 30,
            backgroundColor: "yellowgreen",
            fontSize: 24,
            color: "black",
          }}
          onClick={() => {}}
        />
      </>
    );
  }

  const button_notification = (
    <div>
      {page === "WAITING" ? <Waiting /> : <></>}
      {page === "DONE" ? <MeshViewer /> : <></>}
      {page === "QR" ? <QRRequest /> : <></>}
    </div>
  );
  return button_notification;
}

export default Viewer;
